import http from "./http-common";

class ChessService{
    async getPosition(){
        return http.get("/position");

    }
    async putMove(move){
        return http.put("/move", {
            move:move,
            headers: {
            'Access-Control-Allow-Origin': 'http://localhost:8080'
          }});
    }
    async undo(val){
        var url = '/undo/'+ val;
        return http.put(url);
    }

}

export default new ChessService()
